// frontend/src/components/AdminUploadTool.jsx

import React from "react";

function AdminUploadTool() {
  return (
    <div style={{ padding: "20px" }}>
      <h2>Admin Upload Tool</h2>
      <p>This is where the admin can upload and manage game spread data.</p>
      {/* You can plug in file upload logic or other admin tools here */}
    </div>
  );
}

export default AdminUploadTool;
